           Volta Lula, e explica os 0,20 centavos mais caros do planeta;

           Volta Lula, e explica os 39 ministérios;

           Volta Lula, e explica a falência da Petrobras;

           Volta Lula e explica os 20% de inadimplência do programa eleitoral "Minha Casa Minha Vida", que os brasileiros que trabalham terão que pagar. Observe também que a taxa de inadimplência de 16% gerou a crise imobiliária de 2007 dos Estados Unidos.

           Volta Lula, e explica o que aconteceu com o óleo de mamona que ia ser a independência energética do Brasil;

           Volta Lula, e explica, o PRÉ-SAL;

           Volta Lula, e explica essa sua criação, o poste "DILMA" que você plantou em Brasília...

           Volta Lula, e explica porque o ministro do supremo Roberto Barroso passou uma semana inteira tentando explicar o contrato milionário que o governo, por meio da Eletronorte, concedeu recentemente - sem licitação, ao seu escritório de advocacia do Rio de Janeiro.

           Milhões de Brasileiros estão decepcionados: O LULA ESTÁ MUDO!

           Todos sabem que, se o Lula se explicar, O PT E OS ALIADOS SERÃO TODOS TRANCAFIADOS!

           VOLTA LOGO E VOLTE PRA CADEIA TAMBÉM !!!!!!

	PEÇO MACIÇA DIVULGAÇÃO!

	Começou a rodada de pizza. Tenha coragem e encaminhe esta mensagem para cada contato seu. Não podemos deixar essa situação acontecer. Seja patriota e proteste, enviando esta mensagem para conhecimento de todos. Vamos reagir, POVO.
Por favor, vamos dar uma resposta para esses ladrões. Vamos salvar o nosso futuro.


*Senador Mão Santa falou:*
*“Quando a esquerda não está mentindo está roubando. Quando não está roubando está mentindo, às vezes mente e rouba ao mesmo tempo. Quando não estiver mentindo e nem roubando, está cooptando parceiros ao crime e às falcatruas, ou enganando o povo com falsas promessas (fake wews) eleitoreiras ou com uma retórica 171, engendrando, ensinando/treinando a mentir e a roubar. Dentro da normalidade estão mentindo e roubando e tudo mais ao mesmo tempo.” *
